package stringExample;

public class CompareTo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String s1="Hari";
		String s2="Hari";
		
		int i=s1.compareTo(s2);
		System.out.println(i);
		
		//s1>s2 = positive number
		//s1<s2 = negative number
		//s1==s2 =0
	}

}
